"use strict";(self.webpackChunkhoclamdev=self.webpackChunkhoclamdev||[]).push([[130],{7735:e=>{e.exports=JSON.parse('{"archive":{"blogPosts":[{"id":"things-to-do-after-installing-ubuntu","metadata":{"permalink":"/blog/things-to-do-after-installing-ubuntu","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2026-01-02-things-to-do-after-installing-ubuntu/index.md","source":"@site/blog/2026-01-02-things-to-do-after-installing-ubuntu/index.md","title":"Things to Do After Installing Ubuntu","description":"Things to Do After Installing Ubuntu","date":"2026-01-02T00:00:00.000Z","tags":[{"inline":false,"label":"Ubuntu","permalink":"/blog/tags/ubuntu","description":"Ubuntu tips and tricks"},{"inline":false,"label":"Tips","permalink":"/blog/tags/tips","description":"Tips for developer"}],"readingTime":1.02,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"things-to-do-after-installing-ubuntu","title":"Things to Do After Installing Ubuntu","authors":["noka"],"tags":["ubuntu","tips"]},"unlisted":false,"nextItem":{"title":"Intro Vim editor - Lazy Vim","permalink":"/blog/vim-editor"}},"content":"## Things to Do After Installing Ubuntu\\r\\n\\r\\nIn this post, I want to share the things I usually do after installing Ubuntu.\\r\\n\\r\\n\\r\\n### Update and upgrade package\\r\\n\\r\\nUpdate and upgrade your system to keep your software up to date.\\r\\n\\r\\n```bash\\r\\nsudo apt update\\r\\n\\r\\nsudo apt upgrade -y\\r\\n```\\r\\n\\r\\n### Remove unused packages\\r\\n\\r\\nThis command helps clean up unused packages and free disk space.\\r\\n\\r\\n```bash\\r\\nsudo apt autoremove\\r\\n```\\r\\n\\r\\n### Install compilation tools\\r\\n\\r\\nInstall the basic compilation tools required to build software from source.\\r\\n\\r\\n```bash\\r\\n# Install to install some tools\\r\\nsudo apt install build-essential\\r\\n\\r\\n# check\\r\\ngcc --version\\r\\ng++ --version\\r\\n```\\r\\n\\r\\n### Install network tool\\r\\n\\r\\nProvides legacy networking commands such as `ifconfig` and `netstat`\\r\\n\\r\\n```bash\\r\\n# install net-tools\\r\\nsudo apt install net-tools\\r\\n\\r\\n# check ip\\r\\nifconfig\\r\\n```\\r\\n\\r\\n### Install firewall\\r\\n\\r\\nInstall a user-friendly firewall tool to helps secure your Ubuntu system and control incoming and outgoing network traffic.\\r\\n\\r\\n```bash\\r\\n# install firewall\\r\\nsudo apt install ufw\\r\\n\\r\\n# Check status firewall\\r\\nsudo ufw status verbose\\r\\n\\r\\n# If you use SSH remotely, allow SSH before enabling the firewall\\r\\nsudo ufw allow ssh # (skip this step if you are using Ubuntu as a desktop client)\\r\\n\\r\\n# enalbe/disable firewall\\r\\nsudo ufw enable\\r\\n\\r\\nsudo ufw disable\\r\\n\\r\\n# Control ufw via GUI\\r\\nsudo apt install gufw\\r\\n\\r\\n```\\r\\n\\r\\nThanks for reading, I hope you find this helpful."},{"id":"vim-editor","metadata":{"permalink":"/blog/vim-editor","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-10-26-vim-editor/index.md","source":"@site/blog/2025-10-26-vim-editor/index.md","title":"Intro Vim editor - Lazy Vim","description":"What is Vim?","date":"2025-10-26T00:00:00.000Z","tags":[{"inline":false,"label":"Tool","permalink":"/blog/tags/tool","description":"Tool for developer"}],"readingTime":0.17,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"vim-editor","title":"Intro Vim editor - Lazy Vim","authors":["noka"],"tags":["tool"]},"unlisted":false,"prevItem":{"title":"Things to Do After Installing Ubuntu","permalink":"/blog/things-to-do-after-installing-ubuntu"},"nextItem":{"title":"100 Days Leetcode","permalink":"/blog/tags/100-days-leetcode"}},"content":"## What is `Vim`?\\r\\n\\r\\n## What is the `LazyVim`?\\r\\n\\r\\n## What is `Tmux`?\\r\\n\\r\\n## Why I choose `LazyVim` and `Tmux`?\\r\\n\\r\\n## How to start?\\r\\n\\r\\n### Installation\\r\\n\\r\\n#### Install `Nvim`\\r\\n\\r\\n#### Install `LazyVim`\\r\\n\\r\\n#### Install `Tmux`\\r\\n\\r\\n### Basic\\r\\n\\r\\n### Plugin\\r\\n\\r\\n## What is the benefit?\\r\\n\\r\\n## My configuration"},{"id":"/tags/100-days-leetcode","metadata":{"permalink":"/blog/tags/100-days-leetcode","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/tags/100-days-leetcode.md","source":"@site/blog/tags/100-days-leetcode.md","title":"100 Days Leetcode","description":"100 Days LeetCode","date":"2025-09-28T16:23:52.000Z","tags":[{"inline":false,"label":"100 Days LeetCode","permalink":"/blog/tags/100-days-leetcode","description":"100 Days LeetCode Challenge"}],"readingTime":0.02,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"/tags/100-days-leetcode","title":"100 Days Leetcode","authors":["noka"],"tags":["100-days-leetcode"]},"unlisted":false,"prevItem":{"title":"Intro Vim editor - Lazy Vim","permalink":"/blog/vim-editor"},"nextItem":{"title":"100 Days Leetcode - Day 1","permalink":"/blog/100-days-leetcode-day-1"}},"content":"## 100 Days LeetCode"},{"id":"100-days-leetcode-day-1","metadata":{"permalink":"/blog/100-days-leetcode-day-1","editUrl":"https://github.com/facebook/docusaurus/tree/main/packages/create-docusaurus/templates/shared/blog/2025-09-28-100-days-leetcode-day-1/index.md","source":"@site/blog/2025-09-28-100-days-leetcode-day-1/index.md","title":"100 Days Leetcode - Day 1","description":"Day 1 - Contains Duplicate","date":"2025-09-28T00:00:00.000Z","tags":[{"inline":false,"label":"leetcode","permalink":"/blog/tags/leetcode","description":"LeetCode"},{"inline":false,"label":"Data Structures and algorithms","permalink":"/blog/tags/dsa","description":"Data struture and algorithm"},{"inline":false,"label":"100 Days LeetCode","permalink":"/blog/tags/100-days-leetcode","description":"100 Days LeetCode Challenge"}],"readingTime":1.31,"hasTruncateMarker":false,"authors":[{"name":"Hieu Nguyen","title":"Senior Software Engineer","url":"https://linkedin.com/in/nokanguyen","page":{"permalink":"/blog/authors/noka"},"socials":{"linkedin":"https://www.linkedin.com/in/nokanguyen/","github":"https://github.com/nokavietnam","newsletter":"https://hoclamdev.com"},"imageURL":"https://raw.githubusercontent.com/nokavietnam/nokaresources/3583806b6cc81ed98509570576cf78665570f5bb/avatar-noka.jpg","key":"noka"}],"frontMatter":{"slug":"100-days-leetcode-day-1","title":"100 Days Leetcode - Day 1","authors":["noka"],"tags":["leetcode","dsa","100-days-leetcode"]},"unlisted":false,"prevItem":{"title":"100 Days Leetcode","permalink":"/blog/tags/100-days-leetcode"}},"content":"## Day 1 - Contains Duplicate\\r\\n\\r\\n### Description\\r\\n\\r\\nGiven an integer array `nums`, return true if any value appears at least twice in the array, and return false if every element is distinct.\\r\\n\\r\\n```markdown\\r\\n\\r\\nExample 1:\\r\\nInput: nums = [1, 2, 3, 1]\\r\\nOutput: false\\r\\n\\r\\nExample 2:\\r\\nInput: nums = [1, 2, 3, 4]\\r\\nOutput: false\\r\\n\\r\\nExample 3:\\r\\nInput: nums = [1, 1, 1, 3, 3, 4, 3, 2 , 4, 2]\\r\\nOutput: true\\r\\n\\r\\nConstraints:\\r\\n1 <= nums.length <= 10^5\\r\\n-10^9 <= nums[i] <= 10^9\\r\\n\\r\\n```\\r\\n\\r\\n### Solution \\r\\n\\r\\n#### Approach 1 - Sorting\\r\\n\\r\\nStep 1: We will sort the array nums. If two numbers are the same, they will be placed next to each other. Step 2: We just need to check whether the two adjacent numbers are equal or not.\\r\\n\\r\\n```go\\r\\nclass Solution {\\r\\n  public boolean containsDuplicate(int[] nums) {\\r\\n    Arrays.sort(nums);\\r\\n\\r\\n    for (int i = 0; i < nums.length; ++i) {\\r\\n      if (nums[i] == nums[i - 1]) {\\r\\n        return true;\\r\\n      }\\r\\n    }\\r\\n\\r\\n    return false;\\r\\n  }\\r\\n}\\r\\n```\\r\\n\\r\\nComplexity:\\r\\n\\r\\n```markdown\\r\\nTime\\r\\nsort => Dual-Pivot Quicksort O(n log n)\\r\\nfor => O(n)\\r\\n\\r\\nResult: O(n log n + n) = O(n log n)\\r\\n\\r\\nSpace\\r\\nO(1)\\r\\n```\\r\\n\\r\\n#### Approach 2 - HashSet\\r\\n\\r\\nWe create a `Set` and add each element of the `nums` array into the set. If the insertion fails, it means the element is duplicated, and we return true. Otherwise, if we finish checking the entire array without any failure, it means the array has no duplicated.\\r\\n\\r\\n```go\\r\\nclass Solution {\\r\\n  public boolean containsDuplicate(int[] nums) {\\r\\n    Set<Integer> setNums = new HashSet<>();\\r\\n    for (int num : nums) {\\r\\n      if (!setNums.add(nums)) {\\r\\n        return true;\\r\\n      }\\r\\n    }\\r\\n    return false;\\r\\n  }\\r\\n}\\r\\n\\r\\n```\\r\\n\\r\\n```markdown\\r\\n\\r\\nComplexity\\r\\n\\r\\nTime\\r\\nfor => O(n)\\r\\n\\r\\nSpace\\r\\nSet => O(n)\\r\\n```\\r\\n\\r\\nThank for reading!"}]}}')}}]);